import React, { useEffect, useState } from 'react';
import { api } from '../services/api';
import '../styles/EndUserManagement.css';

function EndUserManagement({ userId }) {
  const [userApps, setUserApps] = useState([]);
  const [availableApps, setAvailableApps] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);
  const [accessRequestReason, setAccessRequestReason] = useState('');
  const [selectedApp, setSelectedApp] = useState(null);

  useEffect(() => {
    fetchUserData();
  }, [userId]);

  const fetchUserData = async () => {
    try {
      setLoading(true);
      setError(null);

      // Fetch user's assigned applications
      const userAppsData = await api.getUserApplications(userId);
      setUserApps(userAppsData);

      // Fetch all available applications
      const allAppsData = await api.getApplications();
      setAvailableApps(allAppsData);

      setLoading(false);
    } catch (err) {
      console.error('Error fetching user data:', err);
      setError('Failed to fetch data. Please try again later.');
      setLoading(false);
    }
  };

  const handleRequestAccess = async (appId) => {
    if (!accessRequestReason.trim()) {
      setError('Please provide a reason for access request');
      return;
    }

    try {
      await api.requestApplicationAccess(userId, appId, accessRequestReason);
      setSuccess('Access request submitted successfully');
      setAccessRequestReason('');
      setSelectedApp(null);
      setTimeout(() => setSuccess(null), 3000);
    } catch (err) {
      setError('Failed to submit access request');
    }
  };

  const handleRemoveAccess = async (appId) => {
    try {
      await api.removeUserFromApplication(userId, appId);
      setUserApps(userApps.filter(app => app.app_id !== appId));
      setSuccess('Access removed successfully');
      setTimeout(() => setSuccess(null), 3000);
    } catch (err) {
      setError('Failed to remove access');
    }
  };

  if (loading) return <div className="loading">Loading...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="end-user-management-container">
      <div className="end-user-management-header">
        <h3>My Applications</h3>
      </div>

      {success && <div className="success-message">{success}</div>}
      {error && <div className="error-message">{error}</div>}

      <div className="user-apps-section">
        <h4>My Assigned Applications</h4>
        {userApps.length > 0 ? (
          <div className="apps-grid">
            {userApps.map(app => (
              <div key={app.app_id} className="app-card">
                <div className="app-info">
                  <h5>{app.app_name}</h5>
                  <p className="app-role">Role: {app.role}</p>
                  <p className="app-description">{app.description || 'No description available'}</p>
                </div>
                <div className="app-actions">
                  <a 
                    href={app.app_url} 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="access-button"
                  >
                    Access Application
                  </a>
                  <button 
                    className="remove-access-button"
                    onClick={() => handleRemoveAccess(app.app_id)}
                  >
                    Remove Access
                  </button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <p className="no-apps-message">You don't have access to any applications yet.</p>
        )}
      </div>

      <div className="available-apps-section">
        <h4>Available Applications</h4>
        <div className="apps-grid">
          {availableApps
            .filter(app => !userApps.some(userApp => userApp.app_id === app.app_id))
            .map(app => (
              <div key={app.app_id} className="app-card">
                <div className="app-info">
                  <h5>{app.app_name}</h5>
                  <p className="app-description">{app.description || 'No description available'}</p>
                </div>
                <div className="app-actions">
                  <button 
                    className="request-access-button"
                    onClick={() => setSelectedApp(app)}
                  >
                    Request Access
                  </button>
                </div>
              </div>
            ))}
        </div>
      </div>

      {selectedApp && (
        <div className="access-request-modal">
          <div className="modal-content">
            <h4>Request Access to {selectedApp.app_name}</h4>
            <textarea
              value={accessRequestReason}
              onChange={(e) => setAccessRequestReason(e.target.value)}
              placeholder="Please provide a reason for requesting access..."
              rows="4"
            />
            <div className="modal-actions">
              <button 
                className="submit-request-button"
                onClick={() => handleRequestAccess(selectedApp.app_id)}
              >
                Submit Request
              </button>
              <button 
                className="cancel-button"
                onClick={() => {
                  setSelectedApp(null);
                  setAccessRequestReason('');
                }}
              >
                Cancel
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default EndUserManagement;
